import styled from 'styled-components';

export const Header = styled.header`

  height: 740px;
  width: 1280px;
  `;

export const StyledHeaderImage = styled.img`
z-index: 0;
position: absolute;

`;

export const InfoAboutBlurredContainer = styled.div`
position: absolute;
  width: 499px;
  height: 370px;
top: 171px;
left: 132px;

`;

export const InfoAboutBlurred = styled.img`
position: absolute;
width: 100%;
height: 100%;
box-shadow: inset 2px 2px 3000px rgba(255, 255, 255, .5); 
filter: blur(5px);
`;
